//응답 결과 세팅
  private Set_Result(responseData: {}) {
    this.bVisible = true;

    //날짜
    let currentDate = new Date();
    let months = ["January", "February", "March", "April", "May", "June", "July", "August", "September", "October", "November", "December",];
    let days = ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday",];

    let day = days[currentDate.getDay()];
    let date = currentDate.getDate();
    let month = months[currentDate.getMonth()];
    let year = currentDate.getFullYear();

    //온도, 날씨, 나라
    let temp = responseData['main'];
    let weather = responseData['weather'];
    let country = responseData['sys'];

    this.weatherInfo.nTemp = parseFloat(temp['temp']);
    this.weatherInfo.temp = temp['temp'] + '℃';
    this.weatherInfo.name = responseData['name'];
    this.weatherInfo.country = country['country'];
    this.weatherInfo.date = day + ' ' + date + ' ' + month + ' ' + year;
    this.weatherInfo.weather = weather[0].main;

    //온도에 따라 배경 이미지 변경을 위해 class명 지정
    if (this.weatherInfo.nTemp > 16) {
      this.styleArray.warm = true;
      this.styleArray.cold = false;
    }
    else {
      this.styleArray.warm = false;
      this.styleArray.cold = true;
    }
  }

