type GetLength<original extends any[]> = original extends {
    length: infer L;
}
    ? L
    : never;
type TransactionHandler<Param extends any[], Value> = (
    conn: PoolConnection,
    …param: Param
) => Promise<Value>;
type ExtractFunction<T> = T extends (…args: infer Args) => infer Return ?  {
    Arg: Args,
    Return: Return 
} : {
    Arg: any[],
    Return: any
}; 
type LinkedRecord<Param extends any[],Value,RecordList extends TransactionHandler<any,any>[]> = {
    [K in keyof RecordList]: TransactionHandler<
        K extends 0 ? Param : ExtractFunction<RecordList[K-1]>["Arg"],
        K extends GetLength<RecordList> ? Value : ExtractFunction<RecordList[K-1]>["Return"]
    >
};

export function pipe<T1>(fn0: () => T1): () => T1;
export function pipe<V0, T1>(fn0: (x0: V0) => T1): (x0: V0) => T1;
export function pipe<V0, V1, T1>(fn0: (x0: V0, x1: V1) => T1): (x0: V0, x1: V1) => T1;
export function pipe<V0, V1, V2, T1>(fn0: (x0: V0, x1: V1, x2: V2) => T1): (x0: V0, x1: V1, x2: V2) => T1;
